        }
    }

    render() {
    return (
            <div>
               <h1> {this.props.type} </h1>
               <Container className="conteinerBackground" >  
                    <Form className="form" >
                        <Col>
                            <FormGroup color="#240C0C">
                                Child Payments
                            </FormGroup>
                        </Col>
                    </Form>
                </Container>
            </div>
        )
    }
}

export default ChildPayment
